import React from 'react';
import {Link} from 'react-router-dom'

function LinkFavorites (props) {
  return (
    <div className="linkLayout linkLayout--active">
      <Link
        to="/Favorites"
        className="link"
      >
        Избранное
      </Link>
    </div>
  )
}

export default LinkFavorites
